        if weather_condition == 'sunny':
            return 'radiantly'
        elif weather_condition == 'partly cloudy':
            return 'glowing'
        elif weather_condition == 'cloudy' or weather_condition == 'rainy':
            return 'shimmering'
    elif time.hour >= 18 and time.hour < 24:
        if weather_condition == 'sunny':
            return 'dazzlingly'
        elif weather_condition == 'partly cloudy':
            return 'vibrant'
        elif weather_condition == 'cloudy' or weather_condition == 'rainy':
            return 'faintly'

